import React from 'react'
const netflixLogo='https://upload.wikimedia.org/wikipedia/commons/0/08/Netflix_2015_logo.svg'
function NavBar() {
    return (
        <>
           <div>
               <img style src={netflixLogo} alt="netflixLogo"/>
           </div>
        </>
    )
}

export default NavBar
